import randomclass AI:    '''a class ai that makes the object of the ai players'''    COLUMNS = [0,1,2,3,4,5,6]    def __init__(self, game, player):        '''this method is the constructor of the objects in the class (the AI players)         and gives them their attributes: game, player'''        self.__game = game        self.__player = player    def find_legal_move(self,timeout = None):        '''this method picks a random number from 0 to 6 and if the column with the num isn't full retuns        it and if it is full finds a different number'''        columns = AI.COLUMNS[:]        if self.__game.get_winner() != None:            raise Exception("No possible AI moves.")        if self.__game.get_player_at(5,3) == None:            return 3        while columns != []:            column = random.choice(columns)            if self.__game.get_player_at(0,column) != None:                columns.remove(column)                continue            return column    def get_last_found_move(self):        pass